import data from "../../../data/navBar.json";

const NavBar = (props) => {
  return (
    <div className="navbar">
      <ul>
        {data.map((item, index) => (
          <li key={index} className={item.active ? "active" : ""}>
            <i className={`fas${item.icon}`} />
            {item.type}
          </li>
        ))}
      </ul>
    </div>
  );
};
export default NavBar;
